<input type="checkbox" id="caja">
</div>
<script>
const caja=document.getElementById('caja');
const mapa=document.getElementById('mapa');

function mover(){
 const rect = mapa.getBoundingClientRect();
 const ancho = rect.width;
 const alto  = rect.height;

 const nuevaX = Math.random() * (ancho - 60);
 const nuevaY = Math.random() * (alto - 60);

 caja.style.left = nuevaX + 'px';
 caja.style.top  = nuevaY + 'px';
}

caja.addEventListener('mouseover', mover);
caja.addEventListener('touchstart', e=>{ e.preventDefault(); mover(); });
</script>
</body>
